import React, { Component } from 'react';

class topmenu extends Component {
    render() {
        return (
            <nav id="nav">
            <div id="profile">
              <img src="image/duongdo.jpg" className="rounded-circle" width={70} height={70} /></div>
            <div id="bt">
              <ul>
                <li> <i className="fas fa-home" /> <a href="#hero-container">Home</a></li>
                <li> <i className="fas fa-user-circle" /> <a href="#about">Abouts</a></li>
                <li> <i className="fas fa-image"> </i> <a href="#interest">Favorite</a></li>
                <li> <i className="fas fa-tasks"> </i> <a href="#contact">Contact</a></li>
                <li> <i className="fas fa-location-arrow"> </i> <a href="#contact">Location</a></li>
                <li> 
                  <i className="fas fa-envelope" />
                  <a href="lab.html">Lab</a>
                  <ul className="sub-menu">
                    <li><a href="#homework" />Lab1</li>
                    <li><a href />Lab2</li>
                    <li><a href />Lab3</li>
                  </ul>
                </li>
              </ul>
            </div>
          </nav> 
        );
    }
}

export default topmenu;
